        #region Tests for CameraBL

        [TestMethod]
        public void TestMethod_Test_Camera_BL()
        {
            // create BL object
            IBusinessLogic businessLogic = BLFactory.CreateBusinessLogic();
            ICamera cameraBL = businessLogic.CreateCameraBL();

            // these tests only makes sense with a camera 
            if (cameraBL.IsCameraAvailable == true)
            {
                // test set camera resolution
                // as we do not know the available resolutions (differs from camera to camera)
                // we just can test an invalid value
                cameraBL.SetCameraResolution(0, 0);
                Assert.IsTrue(cameraBL.FrameHeight > 0);
                Assert.IsTrue(cameraBL.FrameWidth  > 0);

                // try to get an image from the camera
                Assert.IsNotNull(cameraBL.QueryFrame());
            }
        }
        
