        #region Tests for FaceDetectBL
        [TestMethod]
        public void TestMethod_Test_FaceDetect_BL()
        {
            // create BL object
            IBusinessLogic businessLogic = BLFactory.CreateBusinessLogic();
            IFaceDetect faceDetectBL = businessLogic.CreateFaceDetectBL();

            // try get the algorithms
            Array faceDetectionAlgorithms = faceDetectBL.GetFaceDetectionAlgorithms();
            Assert.IsTrue(faceDetectionAlgorithms.Length > 0);

            // test if there is our test image 
            Assert.IsTrue(File.Exists(pathToTestImage));

            // test the different face detection algorithms
            for (int i = 0; i < faceDetectionAlgorithms.Length; i++)
            {
                Image ladyInRed = Image.FromFile(pathToTestImage);
                IList<RoI> rois = faceDetectBL.DetectFaces(ladyInRed, (EnumDetectionType)faceDetectionAlgorithms.GetValue(0), 1.2, 3, new Size(10, 10));
                Assert.IsTrue(rois.Count > 0);
            }
        }
        #endregion

        #region Tests for JpegOperationBL

        [TestMethod]
        public void TestMethod_Test_JpegOperation_BL()
        {
            // create BL object
            IBusinessLogic businessLogic = BLFactory.CreateBusinessLogic();
            IJpegOperation jpegOperationBL = businessLogic.CreateJpegOperationBL();

             // test if there is our test image 
            Assert.IsTrue(File.Exists(pathToTestImage));

            // load image
            Image ladyInRed = Image.FromFile(pathToTestImage);

            // convert to byte array
            byte[] ladyInRedAsByteArray = jpegOperationBL.ConvertImageToByteArray(ladyInRed);
            Assert.IsNotNull(ladyInRedAsByteArray);

            // convert back
            Image ladyInRedConvertedBack = jpegOperationBL.ConvertByteArrayToImage(ladyInRedAsByteArray);
            byte[] ladyInRedConvertedBackAsByteArray = jpegOperationBL.ConvertImageToByteArray(ladyInRed);

            // check result
            for (int i = 0; i < ladyInRedAsByteArray.Length; i++)
            {
                Assert.IsTrue((byte)ladyInRedAsByteArray.GetValue(i) == (byte)ladyInRedConvertedBackAsByteArray.GetValue(i));
            }

            // check jpeg format
            Assert.IsTrue(jpegOperationBL.IsJpegImage(ladyInRed));
            Assert.IsFalse(jpegOperationBL.IsJpegImage(new Bitmap(50,50)));

        }

        #endregion

        #region Tests for RaspberryPiBL
        
        [TestMethod]
        public void TestMethod_Test_RaspberryPi_BL()
        {
            // create BL object
            IBusinessLogic businessLogic = BLFactory.CreateBusinessLogic();
            IRaspberryPi raspberryPiBL = businessLogic.CreateRaspberryPiBL();

            // test image from Raspberry Pi website
            string url = "http://www.raspberrypi.org/img/sprite.png";

            // check if computer is connected to the internet
            bool computerIsConnectedToInternet = false;
            try
            {
                using (var stream = new WebClient().OpenRead("http://www.google.com"))
                    computerIsConnectedToInternet = true;
            }
            catch
            {
                computerIsConnectedToInternet = false;
            }

            // the next test only makes sense if we are connected to the interet
            if (computerIsConnectedToInternet == true)
            {
                // try to get the image sync
                Image image = raspberryPiBL.GetImageFromURLSync(url, "");
                Assert.IsNotNull(image);

                // try to get the image async
                image = raspberryPiBL.GetImageFromUrlASync(url).Result;
                Assert.IsNotNull(image);
            }
        }
        
